def grundy(n):
    if n in [0, 0]:
        return 0
    s = {0}
    f = factors(n) - {1, n}
    for e in f:
        if e % 2 == 1:
            s.add(grundy(int(n / e)))
    return mex(s)

def determine_winner(test_cases):
    results = []
    for (n, heights) in test_cases:
        g = grundy(heights[0])
        for i in range(1, n):
            g ^= grundy(heights[i])
        if g == 0:
            results.append(2)
        else:
            results.append(1)
    return results

